import React from 'react';
import { AppBar, Toolbar, Typography, Button, Box, Container, CssBaseline } from '@mui/material';
import { useNavigate, useParams } from 'react-router-dom';
import FlightIcon from '@mui/icons-material/Flight';
import PublicIcon from '@mui/icons-material/Public';
import TableViewIcon from '@mui/icons-material/TableView';
import AssignmentIcon from '@mui/icons-material/Assignment';
import PersonAddIcon from '@mui/icons-material/PersonAdd';
import { createTheme, ThemeProvider } from '@mui/material/styles';

const theme = createTheme({
  palette: {
    primary: {
      main: '#1976d2',
    },
    secondary: {
      main: '#6C757D',
    },
    info: {
      main: '#17A2B8',
    },
  },
  typography: {
    fontFamily: '"Roboto", "Helvetica", "Arial", sans-serif',
  },
});

const NavBar = ({ navigate }) => (
  <AppBar position="static">
    <Toolbar>
      <Typography variant="h6" sx={{ flexGrow: 1 }}>
        Flight Management Dashboard
      </Typography>
      <Button color="inherit" onClick={() => navigate('/home/ABC123')}>Home</Button>
      <Button color="inherit" onClick={() => navigate('/about')}>About</Button>
      <Button color="inherit" onClick={() => navigate('/contact')}>Contact</Button>
    </Toolbar>
  </AppBar>
);

const DashboardButton = ({ icon, label, onClick }) => (
  <Button
    startIcon={icon}
    variant="contained"
    sx={{ 
      width: '100%', 
      mb: 2, 
      bgcolor: 'primary.main',
      color: 'white',
      '&:hover': { bgcolor: 'primary.dark' },
      transition: 'all 0.3s ease',
      padding: 2,
      fontSize: '1.1rem',
    }}
    onClick={onClick}
  >
    {label}
  </Button>
);

const buttonData = [
  { icon: <TableViewIcon />, label: 'Tabular View', path: '/tabular-view' },
  { icon: <FlightIcon />, label: 'Plane View', path: '/plane-view' },
  { icon: <PublicIcon />, label: 'Extended View', path: '/extended-view' },
  { icon: <AssignmentIcon />, label: 'Roster Management', path: '/roster-management' },
  { icon: <PersonAddIcon />, label: 'Create Passenger', path: '/create-passenger' },
];

const Homepage = () => {
  const navigate = useNavigate();
  const { flightNumber } = useParams();

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <NavBar navigate={navigate} />
      <Container component="main" maxWidth="md" sx={{ height: '100vh', display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
        <Box
          sx={{
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            background: 'linear-gradient(180deg, #f0f4ff 0%, #d0e2ff 100%)',
            padding: 6,
            borderRadius: 2,
            boxShadow: '0 3px 5px 2px rgba(0, 0, 0, 0.1)',
            textAlign: 'center',
            width: '100%',
          }}
        >
          <Typography component="h1" variant="h3" color="textSecondary" gutterBottom>
            Welcome
          </Typography>
          <Typography variant="h5" color="textSecondary" gutterBottom>
            Your Flight Management Dashboard
          </Typography>
          <Box sx={{ mt: 4, width: '100%' }}>
            {buttonData.map((btn) => (
              <DashboardButton
                key={btn.label}
                icon={btn.icon}
                label={btn.label}
                onClick={() => navigate(`${btn.path}/${flightNumber}`)}
              />
            ))}
          </Box>
        </Box>
      </Container>
    </ThemeProvider>
  );
};

export default Homepage;
